export function editDeliveryRequest(id) {
  return {
    type: '@delivery/EDIT_REQUEST',
    payload: { id },
  };
}

export function editDeliverySuccess(delivery) {
  return {
    type: '@delivery/EDIT_SUCCESS',
    payload: { delivery },
  };
}

export function editDeliveryFailure() {
  return {
    type: '@delivery/EDIT_FAILURE',
  };
}
